contract MskManager is ERC20, SafeOwnable {
    using SafeMath for uint256;
    using Address for address;

    address public usdtAddress=0x55d398326f99059fF775485246999027B3197955;
    address public coinAddress=0xfe08Cd4502471283D2b6C7673bDfb3EDc97A427A;

    address public depositAddress=0x1BC9ACCB03E825fa52396A7931941e18E42ae581;
    address public nodesAddress=0x2f50A8F34eb62A98Cb1a545a8c2203603FbcD50E;

    struct BuyStruct{
        address buyAddress;
        uint256 buyAmount;
        uint256 createTime;
    }

    struct EntrustStruct{
        address createAddress;
        address onwerAddress;
        uint256 saleAmount;
        uint256 price;
        uint256 createTime;
        bool onShelves;
    }

    BuyStruct[] public allDeposit;
    BuyStruct[] public allNodes;
    EntrustStruct[] public allEntrusts;

    mapping(address =>mapping(uint256=>uint256)) public deposits;
    mapping(address =>mapping(uint256=>uint256)) public nodes;
    mapping(address =>mapping(uint256=>uint256)) public entrusts;

    mapping(address=>bool) public managerList;
    mapping(address=>bool) public blockList;

    mapping(address=>bool) public depositList;
    mapping(address=>bool) public nodeList;

   
    uint256 public NodeU=2000*10**18;
    uint256 public DepositLeastU=300*10**18;
    uint256 public EntrustLeastU=100*10**18;

    event Desposit(address buyAddress,uint256 buyAmount,uint256 createTime);
    event BuyNode(address buyAddress,uint256 buyAmount,uint256 createTime);
    event OnShelf(address createAddress,uint256 saleAmount,uint256 price,uint256 createTime);
    event OffShelf(address createAddress,uint256 createTime,uint256 saleAmount,uint256 price);
    event EditPrice(address createAddress,uint256 createTime,uint256 saleAmount,uint256 price);
    event BuyShelf(address createAddress,address onwerAddress,uint256 createTime,uint256 saleAmount,uint256 price);
    
    constructor() ERC20("MskManager", "MskManager") {
       setManager(msg.sender,true);
    }

    function allDepositsLength() external view returns(uint256){
        return allDeposit.length;
    }

    function allNodesLength() external view returns(uint256){
        return allNodes.length;
    }

    function allEntrustsLength() external view returns(uint256){
        return allEntrusts.length;
    }

    function getOnEntrustsByPage(uint256 _endtime, uint256 _size) public view returns(EntrustStruct [] memory){
        uint256 index = 0;
        for (uint256 i = allEntrusts.length - 1; i >= 1; i--){
            if(allEntrusts[i].onShelves == true && allEntrusts[i].createTime <= _endtime){
               index++;
            }
            if(index == _size){
                break;
            }
        }
        EntrustStruct[] memory result = new EntrustStruct[](index);
        uint256 l = 0;
        for (uint256 i = allEntrusts.length - 1; i >= 1; i--){
            if(allEntrusts[i].onShelves == true && allEntrusts[i].createTime <= _endtime){
                result[l] = allEntrusts[i];
                l++;
            }
            if(l == index){
                break;
            }
        }
        return result;
    }


    function getOnEntrustsByCreater(uint256 _endtime, uint256 _size, address _address,bool _onShelves,bool _ifBuy) public view returns(EntrustStruct [] memory){
        uint256 index = 0;
        for (uint256 i = allEntrusts.length - 1; i >= 1; i--){
            if(allEntrusts[i].onShelves == _onShelves && allEntrusts[i].createTime <= _endtime && allEntrusts[i].createAddress == _address){
                if(_ifBuy && allEntrusts[i].onwerAddress != allEntrusts[i].createAddress){
                     index++;
                }
                if(!_ifBuy && allEntrusts[i].onwerAddress == allEntrusts[i].createAddress){
                     index++;
                }
            }
            if(index == _size){
                break;
            }
        }
        EntrustStruct[] memory result = new EntrustStruct[](index);
        uint256 l = 0;
        for (uint256 i = allEntrusts.length - 1; i >= 1; i--){
            if(allEntrusts[i].onShelves == _onShelves && allEntrusts[i].createTime <= _endtime && allEntrusts[i].createAddress == _address){
                if(_ifBuy && allEntrusts[i].onwerAddress != allEntrusts[i].createAddress){
                    result[l] = allEntrusts[i];
                    l++;
                }
                if(!_ifBuy && allEntrusts[i].onwerAddress == allEntrusts[i].createAddress){
                    result[l] = allEntrusts[i];
                    l++;
                }
            }
            if(l == index){
                break;
            }
        }
        return result;
    }

    function getOnEntrustsByOwner(uint256 _endtime, uint256 _size, address _address,bool _onShelves) public view returns(EntrustStruct [] memory){
        uint256 index = 0;
        for (uint256 i = allEntrusts.length - 1; i >= 1; i--){
            if(allEntrusts[i].onShelves == _onShelves && allEntrusts[i].createTime <= _endtime && allEntrusts[i].onwerAddress == _address){
               index++;
            }
            if(index == _size){
                break;
            }
        }
        EntrustStruct[] memory result = new EntrustStruct[](index);
        uint256 l = 0;
        for (uint256 i = allEntrusts.length - 1; i >= 1; i--){
            if(allEntrusts[i].onShelves == _onShelves && allEntrusts[i].createTime <= _endtime && allEntrusts[i].onwerAddress == _address){
                result[l] = allEntrusts[i];
                l++;
            }
            if(l == index){
                break;
            }
        }
        return result;
    }

    function desposit(uint256 _amount) external{
        require(_amount>=DepositLeastU,"Error: less than min");
        uint256 _createTime=block.timestamp;

        TransferHelper.safeTransferFrom(coinAddress,msg.sender,depositAddress,_amount);
        BuyStruct memory depositStruct=BuyStruct(msg.sender,_amount,_createTime);
        deposits[msg.sender][_createTime]=allDeposit.length;
        allDeposit.push(depositStruct);
        depositList[msg.sender]=true;
        emit Desposit(msg.sender,_amount,_createTime);
    }


    function buyNode() external{
        uint256 _createTime=block.timestamp;

        TransferHelper.safeTransferFrom(usdtAddress,msg.sender,nodesAddress,NodeU);
        BuyStruct memory nodeStruct=BuyStruct(msg.sender,NodeU,_createTime);
        nodes[msg.sender][_createTime]=allNodes.length;
        allNodes.push(nodeStruct);
        nodeList[msg.sender]=true;
        depositList[msg.sender]=true;
        emit BuyNode(msg.sender,NodeU,_createTime);
    }


    function onShelf(uint256 _amount, uint256 _price) external{
        require(_amount>=EntrustLeastU,"Error: less than min");
        uint256 _createTime=block.timestamp;

        TransferHelper.safeTransferFrom(coinAddress,msg.sender,address(this),_amount);

        EntrustStruct memory entrustStruct=EntrustStruct(msg.sender,msg.sender,_amount,_price,_createTime,true);
        entrusts[msg.sender][_createTime]=allEntrusts.length;
        allEntrusts.push(entrustStruct);
        emit OnShelf(msg.sender,_amount,_price,_createTime);
    }

    function offShelf(uint256 _createTime) external{
        _offShelf(msg.sender,_createTime);
    }
    
    function offShelfForManager(address _address,uint256 _createTime) external onlyManager{
        _offShelf(_address,_createTime);
    }

    function _offShelf(address _address,uint256 _createTime) internal{
        require(!blockList[msg.sender],"Error:blockList");
        uint256 index=entrusts[_address][_createTime];
        require(index!=0,"Error: No position found");
        EntrustStruct memory entrustStruct = allEntrusts[index];
        require(entrustStruct.onShelves,"Error: is off");
        
        TransferHelper.safeTransfer(coinAddress,_address,entrustStruct.saleAmount);

        allEntrusts[index]=EntrustStruct(_address,_address,entrustStruct.saleAmount,entrustStruct.price,_createTime,false);
        emit OffShelf(_address,_createTime,entrustStruct.saleAmount,entrustStruct.price);
    }

    function editPrice(uint256 _createTime,uint256 _price) external{
        require(!blockList[msg.sender],"Error:blockList");
        uint256 index=entrusts[msg.sender][_createTime];
        require(index!=0,"Error: No position found");
        EntrustStruct memory entrustStruct = allEntrusts[index];
        require(entrustStruct.onShelves,"Error: is off");
        
        allEntrusts[index]=EntrustStruct(msg.sender,msg.sender,entrustStruct.saleAmount,_price,_createTime,true);
        emit EditPrice(msg.sender,_createTime,entrustStruct.saleAmount,_price);
    }


    function buyEntrusts(address _address,uint256 _createTime) external{
        require(_address!=msg.sender,"Error:cant buy self");
        require(!blockList[msg.sender],"Error:blockList");
        uint256 index=entrusts[_address][_createTime];
        require(index!=0,"Error: No position found");
        EntrustStruct memory entrustStruct = allEntrusts[index];
        require(entrustStruct.onShelves,"Error: is off");
    
        TransferHelper.safeTransferFrom(usdtAddress,msg.sender,_address,entrustStruct.price);
        TransferHelper.safeTransfer(coinAddress,msg.sender,entrustStruct.saleAmount);

        allEntrusts[index]=EntrustStruct(_address,msg.sender,entrustStruct.saleAmount,entrustStruct.price,_createTime,false);
        emit BuyShelf(_address,msg.sender,_createTime,entrustStruct.saleAmount,entrustStruct.price);
    }

    function claimForOwner() external onlyOwner{
        uint256 amount = IERC20(coinAddress).balanceOf(address(this));
        TransferHelper.safeTransfer(coinAddress,owner(),amount);
    }

    modifier onlyManager() {
        require( managerList[msg.sender] , "Ownable: caller is not the manager");
        _;
    }
    
    function setManager(address _address , bool isManager) public onlyOwner{
        managerList[_address]=isManager;
    }

    function setBlock(address _address , bool isBlock) external onlyOwner{
        blockList[_address]=isBlock;
    }

    function setNodeU(uint256 _amount) external onlyOwner{
        NodeU = _amount;
    }

    function setDepositLeastU(uint256 _amount) external onlyOwner{
        DepositLeastU = _amount;
    }

    function setEntrustLeastU(uint256 _amount) external onlyOwner{
        EntrustLeastU = _amount;
    }

    function setNodesAddress(address _address) external onlyOwner{
        require(_address!=address(0),"Error: is null");
        nodesAddress=_address;
    }

    function setCoinAddress(address _address) external onlyOwner{
        require(_address!=address(0),"Error: is null");
        coinAddress=_address;
    }

    function avoidZero() external onlyOwner{
        require(allDeposit.length==0,"Error: is null");
        require(allNodes.length==0,"Error: is null");
        require(allEntrusts.length==0,"Error: is null");

        BuyStruct memory depositStruct=BuyStruct(address(0),0,block.timestamp);
        allDeposit.push(depositStruct);
        deposits[address(0)][block.timestamp]=0;

        BuyStruct memory nodeStruct=BuyStruct(address(0),0,block.timestamp);
        allNodes.push(nodeStruct);
        nodes[address(0)][block.timestamp]=0;

        EntrustStruct memory entrustStruct=EntrustStruct(address(0),address(0),0,0,block.timestamp,false);
        allEntrusts.push(entrustStruct);
        entrusts[address(0)][block.timestamp]=0;

    }

}
